import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';
import {ajaxGet} from '../../Services/Http/Ajax';
import * as constants from '../../Utils/Constants'
import * as urls from '../../Utils/Urls'
import NameFormComponent from './NameFormComponent';
import AddressFormComponent from './AddressFormComponent';
import ZipFormComponent from './ZipFormComponent';
import ContactNumberFormComponent from './ContactNumberFormComponent';
import MemberCountFormComponent from './MemberCountFormComponent';
import DobFormComponent from './DobFormComponent';
import HousingTypeFormComponent from './HousingTypeFormComponent';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';


const UpdateFamilyContainer = () => {
    const [familyArray, setFamilyArray] = React.useState([]);
    const [childFamilyData, setChildFamilyData] = React.useState([]);

    React.useEffect(() => {
        let url = window.location.href;
        let idx = url.substring(url.lastIndexOf('/') + 1);
        let uri = urls.API_URL.GET_FAMILY_UPDATE_DATA+'/'+idx;
        let familyData;

        ajaxGet(uri, (response) => {
            if (response.status === constants.STATUS_ACTIVE) {
                familyData = response.content;
                let familyArray = familyData.map(family => {
                    return {family}
                });
                setFamilyArray(familyArray);
            }
        });
    }, []);

    const stateChangeInName = (data) => {
        console.log(data);
        setChildFamilyData(data);
        // this.setState( childFamilyData);
    };

    return (

        <div>


            <MenuComponent/>
            <Jumbotron fluid>
                <Container>
                    <h1>Edit Family</h1>
                </Container>
            </Jumbotron>
            <form >
                <Form.Group controlId="exampleForm.ControlInput1">
                    <div className="container">
                        <NameFormComponent test = {familyArray} onSelectedChild = {stateChangeInName}/>
                    </div>
                    <div className="container">
                        <AddressFormComponent onSelectedChild = {stateChangeInName} />
                    </div>
                    <div className="container">
                        <HousingTypeFormComponent onSelectedChild = {stateChangeInName} />
                    </div>
                    <div className="container">
                        <ZipFormComponent onSelectedChild = {stateChangeInName} />
                    </div>
                    <div className="container">
                        <ContactNumberFormComponent onSelectedChild = {stateChangeInName} />
                    </div>
                    <div className="container">
                        <DobFormComponent onSelectedChild = {stateChangeInName} />
                    </div>
                    <div className="container">
                        <MemberCountFormComponent onSelectedChild = {stateChangeInName} />
                    </div>
                    <Jumbotron fluid>
                        <Container>
                            <Button type="submit" variant="primary">Submit</Button>
                        </Container>
                    </Jumbotron>
                </Form.Group>
            </form>
            <FooterComponent/>
        </div>
    )
};

export default UpdateFamilyContainer;
